const validation = (form) => {
    let errors: {};

    if(!/^[a-zA-Z\s]+$/.test(form.name)){
        console.log(`El nombre ${form.name} est치 mal`);
    } else {
        console.log(`El nombre ${form.name} est치 bien`);
    }
}

export default validation;
